open Assert
open X86
open Simulator
open Asm

(* You can use this file for additional test cases to help your *)
(* implementation.                                              *)

let run_mach (m : mach) : mach =
  while m.regs.(rind Rip) <> exit_addr do
    step m
  done;
  m

let make_to_main inp = [ text "main" (inp @ [ (Retq, []) ]) ]

let prnt_regs () (arr : int64 array) : string =
  String.concat "" @@ Array.to_list
  @@ Array.map (fun x -> String.concat "" @@ [ Int64.to_string x; " " ]) arr

let test_sequence (i : X86.ins list) (o : regs * flags) () =
  let res = assemble (make_to_main i) |> load |> run_mach in
  if res.regs <> fst o || res.flags <> snd o then
    failwith
      (Printf.sprintf
         "expected OF:%b SF:%b ZF:%b Regs: %a (got: OF:%b SF:%b ZF:%b Regs: %a)"
         (snd o).fo (snd o).fs (snd o).fz prnt_regs (fst o) res.flags.fo
         res.flags.fs res.flags.fz prnt_regs res.regs)
  else ()

